import Navbar from './components/Navbar'
import WordsList from './components/WordsList'

const words = [
  {
    id: 1,
    title: 'hello',
    definition: 'Greet hello'
  },
  {
    id: 2,
    title: 'hell',
    definition: 'Not a good place'
  }
]

const App = () => {
  return (
    <div className="App">

      <Navbar />


      <WordsList words={words} />

    </div>
  );
}

export default App;
